window.bookSummaryJSON = "<p>This sexy billionaire doesn't need a bride, but he finds himself buying one anyway.</p> <p>Garret Hansen is focused on business, and getting married is the last thing on his mind. Then the woman his company is tasked to protect without her knowledge visits a discreet matchmaker, and it gives him the perfect excuse to provide her with close security . . . as her husband.</p> <p>Keaton Michaels desperately wants to get out from under her father's thumb. Finding a suitable husband is the perfect solution because her wifely duties would take precedence over being a politician's daughter.</p> <p>Their marriage was supposed to be temporary, but love and babies have a way of changing plans.</p>"; 
